function Pessoa() {
    return (
      <div>
        <img
          src="https://i.pinimg.com/originals/02/0e/49/020e49a739bbbd7d7a7ef3e1a40f4234.png"
          alt="Mega Cavaleiro"
          width="300"
        />
        <h2>Nome: Mega Cavaleiro</h2>
        <p>Idade: 35</p>
      </div>
    );
  }
  
  export default Pessoa;
